style.css:
/* Aplicar imagen de fondo */
body {
    background: url("https://www.roblox.com/es/homeall") no-repeat center center fixed;
    background-size: cover;
    margin: 0;
    padding: 0;
    height: 100%;
}

/* Cambiar el color del texto */
p, h1, h2, h3, h4, h5, h6 {
    color: white;
    font-family: Arial, sans-serif;
}
